(1, 'Care2Home', 'images/4ad5f97402f481dc4f45e68c412b5aa6.png', '', 'INR', 'Less Rent, Quick Pick up & Delivery, Good Support, ambulance service Chennai. Driver Support, Best services, First Aid boxes available, call ambulance. 24/7 Service. Quick Pickup. Best Service. Experienced Drivers. Amenities: AC & Non Ac, ICU Ventilators, Oxygen.', 'Version 2.0', 4, 'Less Rent, Quick Pick up & Delivery, Good Support, ambulance service Chennai. Driver Support, Best services, First Aid boxes available, call ambulance. 24/7 Service. Quick Pickup. Best Service. Experienced Drivers. Amenities: AC & Non Ac, ICU Ventilators, Oxygen.', 50, '2022-01-30 13:18:35', '2022-11-29 07:49:41');
INSERT INTO `faqs` (`id`, `question`, `answer`, `image`, `status`, `created_at`, `updated_at`, `faq_category_id`) VALUES
(1, 'What is patient appointment system?', 'What is patient appointment system?\r\nAppointment system is the pre-timing of a patient visit to the hospital for consultation with a doctor. It can also be defined as the assignment of date and time for a patient to conveniently see a doctor.', 'faqs/d8c2e129ce8579bbf89a4439521031a4.jpg', 1, '2022-02-18 13:05:52', '2022-07-19 06:10:44', 1),
(2, 'What is online doctor consultation?', 'Online doctor consultation or online medical consultation is a method to connect patients and doctors virtually. It is a convenient and easy way to get online doctor advice using doctor apps or telemedicine apps or platforms, and the internet.', 'faqs/c1dbf3cb4b30c47929db8772d5921580.jpg', 1, '2022-02-18 13:08:44', '2022-07-19 06:10:57', 2),
(3, 'How do you write a medical order?', 'Patient\'s name and another identifier, usually date of birth.\r\nMedication and strength, amount to be taken, route by which it is to be taken, and frequency.\r\nAmount to be given at the pharmacy and number of refills.\r\nSignature and physician identifiers like NPI or DEA numbers', 'faqs/5e1b0f5bca88416db837c1718a0b0828.png', 1, '2022-02-18 13:10:28', '2022-07-19 06:11:29', 3),
(4, 'What is the purpose of laboratory test?', 'A medical procedure that involves testing a sample of blood, urine, or other substance from the body. Laboratory tests can help determine a diagnosis, plan treatment, check to see if treatment is working, or monitor the disease over time.', 'faqs/c0b239c361730507ff565f5456d2d78e.png', 1, '2022-02-18 13:11:37', '2022-07-19 06:11:40', 4),
(5, 'What does a doctor do daily?', 'Physicians examine patients; take medical histories; prescribe medications; and order, perform, and interpret diagnostic tests. They often counsel patients on diet, hygiene, and preventive healthcare.', 'faqs/24eecd0a3e9f00f31b9afe74a98392dc.jpg', 1, '2022-02-18 13:13:32', '2022-07-19 06:12:21', 5),
(6, 'What are the treatment options for breast cancer?', 'Surgery. An operation where doctors cut out cancer tissue.Chemotherapy. Using special medicines to shrink or kill the cancer cells. .Hormonal therapy. Blocks cancer cells from getting the hormones they need to grow.Biologicaltherapy.Radiation therapy.', 'faqs/7dd3ea1b854f522cc84960422ea01c77.jpg', 1, '2022-02-20 12:36:50', '2022-07-19 06:12:41', 6),
(7, 'How do I charge for the consultation?', 'Consultation fees are decided by you. We have no control on the pricing.', 'faqs/7b23c3ed34bb4c3765df113070c652f3.jpg', 1, '2022-02-20 13:17:34', '2022-07-19 06:12:53', 8),
(8, 'Is the income taxable or will there be any tax deductions from your end?', 'The income generated by the doctor is liable for income tax. WeCare does not deduct any taxes on our side. It is the doctors responsibility to declare the income and file for the taxes. All payments due to the doctor will be made only to his Bank account.', 'faqs/99c4c590082007e7cd00c5533d1d5408.jpg', 1, '2022-02-20 13:22:18', '2022-07-19 06:13:07', 8),
(9, 'Can I disable the recording functionality or made available only to doctor?', 'No. The recording feature is part of the platform. With this feature, the patient and the doctor can use the recorded video to anytime go back to the consultation for any review at a later point. Either parties will be intimated if the record functionality has been invoked.', 'faqs/f5e9e2a27f164f00ed8447b510bf8e2a.jpg', 1, '2022-02-20 13:29:30', '2022-07-19 06:13:23', 1),
(10, 'What do I do if I cannot be available during the booked appointment?', 'We understand that sometimes treatments/procedures can go beyond schedule. Incase you are not able to attend the appointment, you have the option to recommend another time to the patient and if accepted by the patient, the appointment will be rescheduled else the full payment will be refunded back to the customer.', 'faqs/80de5336f711a44a5cc256daee9b425e.webp', 1, '2022-02-20 13:35:18', '2022-07-19 06:13:36', 6),
(11, 'Are online lab tests reliable?', 'An online lab test with the home collection has all the safety, accuracy and quality of a regular test but offers greater convenience and much less stress.', 'faqs/b25470e98e34748d2bbb6b2f34edca57.jpg', 1, '2022-02-20 15:14:55', '2022-07-19 06:13:47', 4),
(12, 'How does online medicine delivery work?', 'An online pharmacy sounds convenient; no waiting in queues, no rushing to the pharmacy before it shuts shop for the day, placing the order is easy, moreover, the order can be placed any time of the day and the medicines are conveniently delivered via courier at your doorstep.', 'faqs/d61e30c459be3debb961ed190226a384.jpg', 1, '2022-02-20 15:40:07', '2022-07-19 06:14:23', 3),
(13, 'Can I talk to an online doctor? Can I chat with a doctor online?', 'Yes, you can chat with a doctor online. Our network of board-certified clinicians are available via chat. They can diagnose, prescribe medication for treatment, issue prescription refills, and more.', 'faqs/c9f8e791012261893016993a01ddaeb3.png', 1, '2022-02-20 16:04:14', '2022-07-19 06:14:39', 2),
(14, 'What is DoctorOnline account?', 'DocOnline is an online doctor consultation platform, which allows you to access Non-Emergency/ Preventive Healthcare from anywhere and at any time!', 'faqs/5923aba029def0ac0a9b6b8a856c27e3.jpg', 1, '2022-02-20 16:08:13', '2022-07-19 06:14:56', 7),
(15, 'What is the responsibility of delivery boy?', 'Carefully loading and unloading all packages. Accepting and recording payment for delivered packages. Answering customers\' questions and responding to complaints in a professional manner. Investigating any discrepancies with the delivered packages.', 'faqs/d73d0be26dd5ba21ab7ab2ecf2e7056a.jpg', 1, '2022-03-10 07:18:56', '2022-07-19 06:15:12', 10),
(16, 'How do i charge for the delivery?', 'Delivery fees are decided by you. We have no control on the pricing.', 'faqs/3f821a4dd3d79c35ef539b6b42673a2d.jpg', 1, '2022-07-13 11:49:22', '2022-07-19 06:15:26', 11);
