(1, 2, 'faq_categories/016049df6da3453419053c33a1e7a369.png', 'Appointments', 'The pre-timing of a patient visit to the hospital for consultation with a doctor.', 1, '2022-02-18 12:43:48', '2022-07-19 06:05:21'),
(2, 4, 'faq_categories/4438adb89a4ef25eabe49764f8f32e36.png', 'Online Consultation', 'virtual consultation by any patient with a concerned doctor using a video call software or application.', 1, '2022-02-18 12:47:00', '2022-07-19 06:08:37'),
(3, 1, 'faq_categories/dedb4586383752e768e5682c76c99a42.png', 'Medicine Orders', 'diagnostic or treatment directives generated by a physician or physician assistant', 1, '2022-02-18 12:50:01', '2022-07-19 06:08:50'),
(4, 1, 'faq_categories/15d38357587f2f69dcd1b3be23fb163b.png', 'Lab Tests', 'Doctors diagnose medical conditions, plan or evaluate treatments, and monitor diseases', 1, '2022-02-18 12:51:49', '2022-07-19 06:09:01'),
(5, 1, 'faq_categories/b3c0c0f4e6c70a69f6b283e9ff248664.png', 'My Account', 'A patient or doctor profile is a collection of information that can be used in a decision analysis situation between the doctor, domain environment, and patient.', 1, '2022-02-18 12:55:03', '2022-07-19 06:06:52'),
(6, 3, 'faq_categories/c6b4f10caecb0aa1ee71b322c5984ec3.png', 'Appointments', 'Get personalized solutions for any health issue with instant online doctor consultation', 1, '2022-02-20 12:08:17', '2022-07-19 06:06:06'),
(7, 3, 'faq_categories/03b7cc4a05919d9ea1ed60fd0ee58ca9.png', 'My Account', 'Greater Efficiency, Accuracy and Cost Reduction. Reduce the Cost of Making Payments While Increasing Provider Satisfaction. Easy Implementation.', 1, '2022-02-20 12:19:01', '2022-07-19 06:09:17'),
(8, 3, 'faq_categories/9481adf0ab152b51c2980ec976b5407a.png', 'Earnings', 'Anyone that earns a doctorate can be called a doctor, but in modern usage.', 1, '2022-02-20 12:27:31', '2022-07-19 06:09:29'),
(10, 4, 'faq_categories/0a4cdcac14a0e9be8112d8edbd68dcfa.png', 'Service', 'Service & helpline number', 1, '2022-03-10 07:03:34', '2022-07-19 06:07:40'),
(11, 4, 'faq_categories/4782faad842df820609a140240d3514f.jpg', 'Earnings', 'Earnings & payment related issues', 1, '2022-03-10 07:05:06', '2022-07-19 06:07:54'),
(12, 4, 'faq_categories/ce737ce9cca333c94348e3a161820bd1.png', 'Order Related Issue', 'Cancellations & orders , delivery related issues', 1, '2022-03-10 07:06:20', '2022-07-19 06:08:07'),
(13, 4, 'faq_categories/6a50d95b7193c5ab6294c9b7c8d9ceb3.png', 'Online/Offline status', 'Current status & details', 1, '2022-03-10 07:07:14', '2022-07-19 06:08:21');
