INSERT INTO `privacy_policies` (`id`, `privacy_policy_type_id`, `title`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'About Us', 'Our Mr.Pharman is a user-friendly app enabling users to easily search and order any personal care items. For medicine order users can also upload a prescription image for added convenience.Our services are subject to the terms and conditions set forth below. Your use of our services indicates your agreement to be bound by the terms and conditions contained  herein. Company never sell your personal information like phone number, address or email Id with any third party. We may change to terms from time to time and it is the current version which will apply to each order when you place it. We will notify you of changes to the Terms by email.', 1, '2019-08-28 06:45:21', '2022-12-23 17:42:46'),
(2, 1, 'Please read the Terms carefully and make sure that you understand them before placing an order.', 'In Mr. Pharman, customers need to provide prescription image for some medicines to buy. In case of any wrong or damage your product must be reported to mrpharmanapp@gmail.com with in 24 hours. Failure to report on right time we don\'t take any responsibility. Compensation shall be provided inform of services and no cash will be given to customers.   Customer might get regular updates through calls/ SMS/ emails/ App notification.\r\n\r\nThis privacy policy describes how we handle the personal information which we collect through our app.\r\nWhat personal information we collect:\r\n\r\n* Identity data such as Name and images \r\n* Contact information including email\r\n* Address \r\n* Other information relevant to customer surveys and/or offers.\r\n\r\nWhat we do with your personal information:\r\n\r\nIn particular for the following reasons:\r\n* Record keeping \r\n* To view your order History. \r\n* we may use the information to improve our service.', 1, '2019-08-28 06:45:35', '2020-04-25 10:19:50'),
