(25, 3, 3, 20, 'Chlorpromazine Tablets IP', 'Chlorpromazine Hydrochloride Tablets IP 25 mg Each Sugarcoated tablets', 'products/e389055077f2689eec829444be858b51.png', 'A sugar-coated tablet is coated with sugar to disguise the taste. A sugar-coated tablet may taste sweeter than a film-coated tablet.', 90, 100, '10%', 3, 1, '2022-12-19 17:26:05', '2022-12-19 17:26:05'),
(26, 3, 3, 21, 'Adderall', 'Adderall, Adderall XR, Mydayis', 'products/71c53772348362c12f1e397efd34d791.png', 'Pill with imprint AD 30 is Orange, Round and has been identified as Adderall 30 mg. It is supplied by Shire US Inc.\r\n\r\nAdderall is used in the treatment of adhd; narcolepsy and belongs to the drug class CNS stimulants. Risk cannot be ruled out during pregnancy.', 90, 100, '10%', 3, 1, '2022-12-19 17:27:02', '2022-12-19 17:27:02'),
